import React from "react";
import LayoutView from "./layoutView";
import CharacterItemComponent from "../components/characterItemComponent";

let CharactersView = (props) =>{
  let listView = data.map((obj) => {
    return <CharacterItemComponent node={obj.node} key={obj.node.id}  getCharacterById={this.getCharacterById.bind(this)} />
  });
  return (
    <LayoutView>
      {listView}
    </LayoutView>
  );
};

export default CharactersView;
